def decode(strr, s1, e1, s2, e2, s3, e3, s4, e4):
	decc = strr[s1:e1] + strr[s2:e2] + strr[s3:e3] + strr[s4:e4]
	decoded = zlib.decompress(base64.b64decode(decc))
	return decoded
